import React from "react";
import { Link, Outlet } from "react-router-dom";
import NavBar from "./NavBar";

const Product = () => {
  return (
    <>
      <Outlet />
      <input type="search" placeholder="Search Product" />
      <nav>
        <Link to="old">Old</Link> <Link to="new">New</Link>
      </nav>
    </>
  );
};

export default Product;
